import data from './data' /* Importou o arquivo com os dados */
import './App.css'

function App() {
  return (
    <div className="App">
      <h1>Pokedex</h1>
      <div className="pokedex"> {/* Javascript coloca entre { } */}
        {data.map(element =>  /* Map para passar por todos os dados do arquivo */
          <div key={element.id}>
            <div>
              <h3>name: {element.name}</h3>
              <h4>type: {element.type}</h4>
            </div>
            <img src={element.image} alt={element.name}/>
          </div>)}
      </div> 
    </div>
  );
}

export default App;
